import { Query } from "react-apollo";

const Past_Launch = (props) => {
  console.log(props);
  return (
    <div>
      <h2>Launch</h2>
      <Query query={props.definitions}>
        {({ loading, error, data }) => {
          if (loading) return <h4>Loading...</h4>;
          if (error) console.log(error);
          console.log(data);
          return (
            <h2>Test</h2>
            //   <Fragment>
            //     {data.launches.map((launch) => (
            //       <LaunchItem key={launch.flight_number} launch={launch} />
            //     ))}
            //   </Fragment>
          );
        }}
      </Query>
    </div>
  );
};

export default Past_Launch;
